create table t_message
(
    id          BIGINT(19) auto_increment
        primary key,
    content     VARCHAR(255)         null comment '消息内容',
    type_id     VARCHAR(255)         null comment '消息类型的id(task_id)',
    type        VARCHAR(255)         null comment '消息类型',
    user_id     BIGINT(19)           null comment '消息接收人',
    create_time BIGINT(19)           null comment '创建时间',
    is_read     TINYINT(3) default 0 null
)
    charset = utf8mb4;

